import React from 'react';
import '../OnBoardingNFT.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import Head from '../GoFundNFT/head';
import NovaEconomiaCriativa from '../OnBoardingNFT/NovaEconomiaCriativa';
import OqueEnFT from '../OnBoardingNFT/OqueEnFT';
import SaibaMais from '../OnBoardingNFT/SaibaMais';
import Footer from "../LandingPage/footer";

function Onboard(){
    return (
        <React.Fragment>
            <Head/>
            <NovaEconomiaCriativa/>
            <OqueEnFT/>
            <SaibaMais/>
            <Footer />
        </React.Fragment>
    );
}

export default Onboard;
